package com.example.auta.domain.entities;import com.example.auta.models.enums.CarStatus;import com.example.auta.models.enums.Suspension;import com.fasterxml.jackson.annotation.JsonIgnoreProperties;import lombok.*;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class CarEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private String licensePlate;    private String make;    private String model;    private Suspension suspension;    private Integer yearOfProduction;    private String color;    private Integer mileage;    private CarStatus carStatus;    private BigDecimal dailyPrice;    @ManyToOne    @ToString.Exclude    @EqualsAndHashCode.Exclude    @JsonIgnoreProperties("cars")    private BranchEntity branch;}